          <h4>VOL.3 - SASUKE</h4>
          <h5>Ehime, Japan</h5>
          <p>宇宙中每颗闪烁的行星，自有其运行的轨道。星星在漫长的一生中，沿着这条线，浪漫又坚毅地行进，每晚固定地出现在我们头顶的夜空中。这很像我们每个人，其实天生自有天赋。只不过有的人需要从小去摸索，在学习中寻找到属于自己的闪光点。有的人则幸运地在一开始就得到命运的宠爱，找到了属于自己的轨道。</p>
